import React, { useState } from 'react';
import { Card, Row, Col, Button, Form, Input, InputNumber, Modal, Typography } from 'antd';
import { PlusOutlined } from '@ant-design/icons';

const { Title } = Typography;

const Projects = () => {
  const [projects, setProjects] = useState([
    { id: 1, title: 'Project 1', description: 'Description of project 1', year: 2024 },
    { id: 2, title: 'Project 2', description: 'Description of project 2', year: 2023 }
  ]);

  const [isModalVisible, setIsModalVisible] = useState(false);
  const [form] = Form.useForm();

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
    form.resetFields();
  };

  const onFinish = (values) => {
    const newProject = {
      id: Date.now(),
      title: values.title,
      description: values.description,
      year: values.year,
      technologies: values.technologies
    };
    
    setProjects([...projects, newProject]);
    setIsModalVisible(false);
    form.resetFields();
  };

  return (
    <div className="projects-page" style={{ padding: '24px' }}>
      <Title level={1} style={{ textAlign: 'center', marginBottom: '24px' }}>My Projects</Title>
      
      <Button 
        type="primary" 
        icon={<PlusOutlined />} 
        onClick={showModal}
        style={{ marginBottom: '24px' }}
      >
        Add New Project
      </Button>

      <Row gutter={[16, 16]}>
        {projects.map((project) => (
          <Col key={project.id} xs={24} sm={12} md={8} lg={6}>
            <Card 
              title={project.title}
              hoverable
              extra={<span style={{ color: '#666' }}>{project.year}</span>}
            >
              <p>{project.description}</p>
              {project.technologies && (
                <p style={{ color: '#1890ff', marginTop: '8px' }}>
                  <strong>Technologies:</strong> {project.technologies}
                </p>
              )}
            </Card>
          </Col>
        ))}
      </Row>

      {/* Add Project Modal */}
      <Modal 
        title="Add New Project" 
        visible={isModalVisible} 
        onCancel={handleCancel}
        footer={null}
      >
        <Form
          form={form}
          layout="vertical"
          onFinish={onFinish}
        >
          <Form.Item
            name="title"
            label="Project Title"
            rules={[{ required: true, message: 'Please input project title!' }]}
          >
            <Input placeholder="Enter project title" />
          </Form.Item>

          <Form.Item
            name="description"
            label="Description"
            rules={[{ required: true, message: 'Please input project description!' }]}
          >
            <Input.TextArea rows={4} placeholder="Enter project description" />
          </Form.Item>

          <Form.Item
            name="year"
            label="Year"
            rules={[{ required: true, message: 'Please input project year!' }]}
          >
            <InputNumber 
              style={{ width: '100%' }} 
              min={2000} 
              max={new Date().getFullYear()} 
              placeholder="Enter project year" 
            />
          </Form.Item>

          <Form.Item
            name="technologies"
            label="Technologies Used"
          >
            <Input placeholder="React, Node.js, MongoDB, etc." />
          </Form.Item>

          <Form.Item>
            <Button type="primary" htmlType="submit" style={{ marginRight: '8px' }}>
              Add Project
            </Button>
            <Button onClick={handleCancel}>
              Cancel
            </Button>
          </Form.Item>
        </Form>
      </Modal>

      <div style={{ textAlign: 'center', marginTop: '40px', color: '#666' }}>
        Portfolio ©{new Date().getFullYear()} Created by You
      </div>
    </div>
  );
};

export default Projects;
